import React from "react";
import react from "react";
import styled from "styled-components";

const primaryColor = "#662d91";
const secondaryColor = "#d0bee4";
const darkgray = "#252525";

const Container = styled.div`
  width: 80px;
  height: 90px;
  margin: 5px 5px 0 5px;
  background-color: #fff;
  border: solid 3px ${primaryColor};
  border-radius: 10px;
  color: ${darkgray};
`;

const renderedStates = stats.forEach((e) => {
  <Container key={e.name}>{e.name}</Container>;
});

const BaseStats = ({ stats }) => {
  return <React.Fragment>{renderedStates(stats)}</React.Fragment>;
};

export default BaseStats;
